import React from 'react';
import styled from 'styled-components';
import Plans from '../components/Plans'; // Adjust the path as needed

const DashboardContainer = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  margin: 20px;
`;

const Dashboard = () => (
  <DashboardContainer>
    <h1>Welcome, [User's Name]</h1>
    <h2>Select a Plan</h2>
    <Plans />
  </DashboardContainer>
);

export default Dashboard;
